import React from "react";
import "./login.css";

import { FcGoogle } from "react-icons/fc";

export default function Login() {
  return (
    <div className="loginBody">
      <form>
        <div className="MainContainer">
            <h2 className="WelcomeText"> Welcome</h2>
            <img src="https://vyaparwebsiteimages.vypcdn.in/logo1.svg" alt="..."/>
            <div className="InputContainer">
                <input type="email" className="inputs" placeholder="Email" required/>
                <input type="password" className="inputs" placeholder="Password" required/>
            </div>
            <div className="ButtonContainer">
                <button className="buttons" type="submit">LOGIN</button>
            </div>
            <div className="ButtonContainer">
                <button className="buttons" type="submit">SIGNUP</button>
            </div>
            <h4 className="ForgotPassword">Forgot Password</h4>            
        </div>
      </form>
    </div>
  );
}
